class Solution:
    def minimumSum(self, a: List[List[int]]) -> int:
        n = len(a)
        m = len(a[0])
        lu = [[0 for j in range(m)] for i in range(n)]
        ld = [[0 for j in range(m)] for i in range(n)]
        ru = [[0 for j in range(m)] for i in range(n)]
        rd = [[0 for j in range(m)] for i in range(n)]
        for x in range(n):
            for y in range(m):
                mini = n+1
                minj = m+1
                maxi = -1
                maxj = -1
                for i in range(x+1):
                    for j in range(y+1):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    lu[x][y] = 0
                else:
                    lu[x][y] = (maxi - mini + 1) * (maxj - minj + 1)

                mini = n+1
                minj = m+1
                maxi = -1
                maxj = -1
                for i in range(x, n):
                    for j in range(y+1):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    ld[x][y] = 0
                else:
                    ld[x][y] = (maxi - mini + 1) * (maxj - minj + 1)

