                for i in range(x+1):
                    for j in range(y, m):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    ru[x][y] = 0
                else:
                    ru[x][y] = (maxi - mini + 1) * (maxj - minj + 1)

                mini = n+1
                minj = m+1
                maxi = -1
                maxj = -1
                for i in range(x, n):
                    for j in range(y, m):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    rd[x][y] = 0
                else:
                    rd[x][y] = (maxi - mini + 1) * (maxj - minj + 1)
        ud = [[0 for j in range(n)] for i in range(n)]
        lr = [[0 for j in range(m)] for i in range(m)]
        for x in range(n):
            for y in range(x,n):
                mini = n+1
                minj = m+1
                maxi = -1
                maxj = -1
                for i in range(x, y+1):
                    for j in range(m):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    ud[x][y] = 0
                else:
                    ud[x][y] = (maxi - mini + 1) * (maxj - minj + 1)
        for x in range(m):
            for y in range(x,m):
                mini = n+1
                minj = m+1
                maxi = -1
                maxj = -1
                for i in range(n):
                    for j in range(x,y+1):
                        if a[i][j] == 1:
                            mini = min(mini, i)
                            minj = min(minj, j)
                            maxi = max(maxi, i)
                            maxj = max(maxj, j)
                if mini > maxi:
                    lr[x][y] = 0
                else:
                    lr[x][y] = (maxi - mini + 1) * (maxj - minj + 1)
        z = n * m
        for i in range(1, n):
            for j in range(1, m):
                z = min(z, lu[i-1][j-1] + ru[i-1][j] + rd[i][0])
                z = min(z, lu[i-1][j-1] + ld[i][j-1] + rd[0][j])
                z = min(z, ld[i][j-1] + rd[i][j] + ru[i-1][0])
                z = min(z, ru[i-1][j] + rd[i][j] + ld[0][j-1])
        for i in range(1, n):
            for j in range(i + 1, n):
                z = min(z, ud[0][i-1] + ud[i][j-1] + ud[j][n-1])
